import React from 'react';
import './NewRestTimer.scss';

const newRestTimer = props => {
  return (
    <div id="new-rest-timer">
        Rest Timer Selection!
      <button type="button" onClick={props.toggleModal}> START </button>
    </div>
  );
}

export default newRestTimer;
